/** @type { React.CSSProperties } */
const HrStyle = {
  margin: 0 + 'px',
  padding: 0 + 'px',
  marginLeft: 1 + 'vw',
  marginRight: 1 + 'vw',
  borderTop: '3px solid #bbb',
}

const Divider = () => <hr style={HrStyle} />;

export { Divider };
